{
    "name": "laravel/horizon",
    "description": "Dashboard and code-driven configuration for Laravel queues.",
    "keywords": ["laravel", "queue"],
    "license": "MIT",
    "authors": [
        {
            "name": "Taylor Otwell",
            "email": "taylor@laravel.com"
        }
    ],
    "require": {
        "php": "^8.0",
        "ext-json": "*",
        "ext-pcntl": "*",
        "ext-posix": "*",
        "illuminate/contracts": "^9.21|^10.0|^11.0",
        "illuminate/queue": "^9.21|^10.0|^11.0",
        "illuminate/support": "^9.21|^10.0|^11.0",
        "nesbot/carbon": "^2.17|^3.0",
        "ramsey/uuid": "^4.0",
        "symfony/console": "^6.0|^7.0",
        "symfony/error-handler": "^6.0|^7.0",
        "symfony/polyfill-php83": "^1.28",
        "symfony/process": "^6.0|^7.0"
    },
    "require-dev": {
        "mockery/mockery": "^1.0",
        "orchestra/testbench": "^7.0|^8.0|^9.0",
        "phpstan/phpstan": "^1.10",
        "phpunit/phpunit": "^9.0|^10.4",
        "predis/predis": "^1.1|^2.0"
    },
    "suggest": {
        "ext-redis": "Required to use the Redis PHP driver.",
        "predis/predis": "Required when not using the Redis PHP driver (^1.1|^2.0)."
    },
    "autoload": {
        "psr-4": {
            "Laravel\\Horizon\\": "src/"
        }
    },
    "autoload-dev": {
        "psr-4": {
            "Laravel\\Horizon\\Tests\\": "tests/",
            "Workbench\\App\\": "workbench/app/",
            "Workbench\\Database\\Factories\\": "workbench/database/factories/",
            "Workbench\\Database\\Seeders\\": "workbench/database/seeders/"
        }
    },
    "extra": {
        "branch-alias": {
            "dev-master": "5.x-dev"
        },
        "laravel": {
            "providers": [
                "Laravel\\Horizon\\HorizonServiceProvider"
            ],
            "aliases": {
                "Horizon": "Laravel\\Horizon\\Horizon"
            }
        }
    },
    "config": {
        "sort-packages": true
    },
    "minimum-stability": "dev",
    "prefer-stable": true,
    "scripts": {
        "post-autoload-dump": "@prepare",
        "clear": "@php vendor/bin/testbench package:purge-skeleton --ansi",
        "prepare": "@php vendor/bin/testbench package:discover --ansi",
        "build": "@php vendor/bin/testbench workbench:build --ansi",
        "serve": [
            "@build",
            "@php vendor/bin/testbench serve"
        ],
        "lint": [
            "@php vendor/bin/phpstan analyse"
        ],
        "test": [
            "@php vendor/bin/phpunit"
        ]
    }
}

